import React, { Component } from 'react';

import {Tabs, WhiteSpace} from 'antd-mobile'


const tabs = [
    { title: '首页' },
    { title: 'Android'},
    { title: '前端' },
    { title: 'iOS'},
    { title: '产品' },
    { title: '设计'},
    { title: '后端' },
];

export default class Home extends Component{

    renderContent = tab =>(
        <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: '100%', backgroundColor: '#fff' ,flexDirection:'row'}}>
            <p>Content of {tab.title}</p>
            <label>123</label>
            <div>123456</div>
        </div>
    );


    render(){
        return (
            <div>

                <div style={{ height: "100%" }}>
                    <Tabs tabs={tabs}
                        initalPage={'2'}
                        renderTabBar={props => <Tabs.DefaultTabBar {...props} />}
                    >
                    {this.renderContent}
                    </Tabs>
                </div>



            </div>
        );
    }
}
